[linkify-it](https://github.com/markdown-it/linkify-it) is links recognition library, and `LinkifyIt.match(text: string)` returns list of urls which is included `text` argument.

```js
const LinkifyIt = require('linkify-it')();
LinkifyIt.match('http://github.com/');
/*
[ Match {
    schema: 'http:',
    index: 0,
    lastIndex: 18,
    raw: 'http://github.com/',
    text: 'http://github.com/',
    url: 'http://github.com/' } ]
/*
```

In `types/linkify-it/index.d.ts`, type of return value is defined as array
```ts
declare namespace LinkifyIt {
    interface LinkifyIt {
        match(text: string): Match[];
    }
}
```
but, `match(text: string)` return `null` if text does not contain any links
```js
const LinkifyIt = require('linkify-it')();
LinkifyIt.match('there is no link');
// => null
```

So, the type should be `Match[] | null`.
